import React from 'react'

const Propertytable = (props) => {
  return (
    <div>
    <table className="table"></table>
       <tbody>
                    <tr>
                        <th scope="row">{props.one}</th>
                        <td>{props.two}</td>
                        <td>{props.three}</td>
                    </tr>
                </tbody>
    
    </div>
  )
}

export default Propertytable;
